import { Fragment } from 'react';

import {ReactComponent as HeaderCartButton} from './HeaderCartButton';
import classes from './Header.module.css';

const Header = (props) => {
  return (
    <Fragment>
      <header className={classes.header}>
        <h1>ReactMeals</h1>
        <div><HeaderCartButton /></div>
      </header>
      <div className={classes["main-image"]}>
        <img src="https://raw.githubusercontent.com/academind/react-complete-guide-code/11-practice-food-order-app/extra-files/meals.jpg" />
      </div>
    </Fragment>
  );
};

export default Header;
